ReactDOM.render(
  <>
    <h1 className=""> List of top 5 Netflix series in 2020</h1>
    {sdata.map((value, index) => {
      console.log(index);
      return (
        <Card
          imgsrc={value.imgsrc}
          title={value.title}
          sname={value.sname}
          link={value.link}
        />
      );
    })}
  </>,
  document.getElementById("root")
);

